(87, 7, 'bg', 'App\\Models\\News', 'title', '\"Лидове новини\" показа схемата за финансиране на сделката за ЧЕЗ', NULL, NULL),
(88, 7, 'en', 'App\\Models\\News', 'title', '\"Лидове новини\" показа схемата за финансиране на сделката за ЧЕЗ', NULL, NULL),
(89, 7, 'bg', 'App\\Models\\News', 'description', 'Как е структурирано финансирането на сделката за активите на чешката ЧЕЗ в България показа електронното издание на чешкия вестник \"Лидове новини\".\n\n\nСпоред публикацията \"Уникредит Булбанк\" участва със 180 млн. евро, Първа инвестиционна банка - с 80 млн. евро. Дружествата Score Trade Global и Victory Trust, които според публикацията са с неясна история на активите, ще осигурят 187 млн. евро. В осигуряването на един от заемите участвала и Euro Star OOD, се казва в публикацията.', NULL, NULL),
(90, 7, 'en', 'App\\Models\\News', 'description', 'Как е структурирано финансирането на сделката за активите на чешката ЧЕЗ в България показа електронното издание на чешкия вестник \"Лидове новини\".\n\n\nСпоред публикацията \"Уникредит Булбанк\" участва със 180 млн. евро, Първа инвестиционна банка - с 80 млн. евро. Дружествата Score Trade Global и Victory Trust, които според публикацията са с неясна история на активите, ще осигурят 187 млн. евро. В осигуряването на един от заемите участвала и Euro Star OOD, се казва в публикацията.', NULL, NULL);
